import React, { useState } from 'react';
import './split.scss';

const RangeSlider = () => {
  const [isActive, setIsActive] = useState(false);
  const [value, setValue] = useState([0, 50]); // 초기값 설정

  const handleRangeChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newValue = [parseInt(event.target.value), value[1]];
    setValue(newValue);
  };

  return (
    <div className={`range-slider ${isActive ? 'active' : ''}`}>
      <input
        type="range"
        min={0}
        max={100}
        value={value[0]}
        onChange={handleRangeChange}
        disabled={!isActive}
      />
      <input
        type="range"
        min={0}
        max={100}
        value={value[1]}
        onChange={(event) => setValue([value[0], parseInt(event.target.value)])}
        disabled={!isActive}
      />
      <button type="button" onClick={() => setIsActive(!isActive)}>
        {isActive ? '활성화' : '비활성화'}
      </button>
    </div>
  );
};

export default RangeSlider;
